import React ,{useState} from "react";
import FriendsBasic from "../friends/friendsBasic";
import FriendsAdd from "../friends/friendsAdd";


function Friends (props) {
    const [friend, setFriend] = useState("")
    const [friendsPage,setFriendsPage] = useState("friendsBasic")
    
    const renderComponent = () => {
        switch (friendsPage) {
            case 'friendsBasic':
                return <FriendsBasic setFriendsPage={setFriendsPage} setRender={props.setChoice} setFriend={props.setFriend} />;
            case 'friendsAdd':
                return <FriendsAdd setFriendsPage={setFriendsPage}/>;
            default:
                return null;
        }
    }

    return(
        <div className="flex flex-col text-white h-full">
            {renderComponent()}
        </div>
    )
}

export default Friends
